    return (
        <div className="containter">
      <motion.div className="box"
      
    animate={{
     x:100, y:100, opacity:1
    }}
    transition={{
        delay:0.2,
        x:{type:"spring", stiffness:100},
        default:{duration}
    }}
    
  />
      
        </div>
      
);
}
export default Projects;
